import React from "react";
import { Link } from "react-router-dom";

const AdminDashboard = () => {
  const styles = {
    container: {
      display: "flex",
      minHeight: "100vh",
      margin: 0,
      fontFamily: "'Roboto', sans-serif",
      backgroundColor: "#eef2f7",
    },
    sidebar: {
      width: "280px",
      backgroundColor: "#2c3e50",
      color: "#ecf0f1",
      padding: "20px 15px",
      boxShadow: "2px 0 8px rgba(0, 0, 0, 0.15)",
    },
    sidebarTitle: {
      fontSize: "24px",
      fontWeight: "bold",
      textAlign: "center",
      marginBottom: "25px",
      letterSpacing: "1px",
    },
    sidebarLink: {
      color: "#ecf0f1",
      textDecoration: "none",
      display: "block",
      padding: "10px 15px",
      borderRadius: "6px",
      margin: "10px 0",
      fontSize: "16px",
      fontWeight: "500",
      transition: "background-color 0.3s, padding-left 0.3s",
    },
    sidebarLinkHover: {
      backgroundColor: "#34495e",
      paddingLeft: "20px",
    },
    mainContent: {
      flexGrow: 1,
      padding: "30px 20px",
    },
    header: {
      backgroundColor: "#3498db",
      color: "#fff",
      padding: "15px",
      borderRadius: "10px",
      marginBottom: "25px",
      textAlign: "center",
      boxShadow: "0 3px 10px rgba(0, 0, 0, 0.15)",
      fontSize: "20px",
      fontWeight: "600",
    },
    cardsContainer: {
      display: "grid",
      gridTemplateColumns: "repeat(auto-fit, minmax(250px, 1fr))",
      gap: "20px",
    },
    card: {
      backgroundColor: "#ffffff",
      padding: "20px",
      borderRadius: "8px",
      textAlign: "center",
      boxShadow: "0 4px 8px rgba(0, 0, 0, 0.15)",
      transition: "transform 0.3s ease, box-shadow 0.3s ease",
      border: "1px solid #dfe6e9",
    },
    cardHover: {
      transform: "scale(1.05)",
      boxShadow: "0 6px 12px rgba(0, 0, 0, 0.25)",
    },
    cardTitle: {
      fontSize: "18px",
      fontWeight: "600",
      color: "#2c3e50",
      marginBottom: "12px",
    },
    cardText: {
      fontSize: "14px",
      color: "#7f8c8d",
      marginBottom: "15px",
    },
    cardLink: {
      color: "#3498db",
      textDecoration: "none",
      fontWeight: "bold",
      padding: "10px 20px",
      borderRadius: "6px",
      backgroundColor: "#f4f9fd",
      border: "1px solid #3498db",
      transition: "background-color 0.3s ease, color 0.3s ease",
    },
    cardLinkHover: {
      backgroundColor: "#3498db",
      color: "#ffffff",
    },
  };

  return (
    <div style={styles.container}>
      {/* Sidebar */}
      <div style={styles.sidebar}>
        <h2 style={styles.sidebarTitle}>ADMIN</h2>
        <ul className="list-unstyled">
          {[
            { to: "/StudentDetails", label: "Student Details" },
            { to: "/MarkView", label: "Mark View" },
            { to: "/logout", label: "Logout" },
          ].map((item, index) => (
            <li key={index}>
              <Link
                to={item.to}
                style={styles.sidebarLink}
                onMouseEnter={(e) => {
                  e.target.style.backgroundColor = styles.sidebarLinkHover.backgroundColor;
                  e.target.style.paddingLeft = styles.sidebarLinkHover.paddingLeft;
                }}
                onMouseLeave={(e) => {
                  e.target.style.backgroundColor = "transparent";
                  e.target.style.paddingLeft = "15px";
                }}
              >
                {item.label}
              </Link>
            </li>
          ))}
        </ul>
      </div>

      {/* Main Content */}
      <div style={styles.mainContent}>
        <header style={styles.header}>
          <h1>Welcome to MCA - Student Dashboard</h1>
        </header>
        <div style={styles.cardsContainer}>
          {[
            { title: "Student Details", text: "Manage Student Details", to: "/boat" },
            { title: "Mark View", text: "View Marks", to: "/event" },
            { title: "More Info", text: "Additional Details", to: "/settings" },
          ].map((card, index) => (
            <div
              style={styles.card}
              key={index}
              onMouseEnter={(e) =>
                Object.assign(e.currentTarget.style, styles.cardHover)
              }
              onMouseLeave={(e) =>
                Object.assign(e.currentTarget.style, {
                  transform: "scale(1)",
                  boxShadow: "0 4px 8px rgba(0, 0, 0, 0.15)",
                })
              }
            >
              <h3 style={styles.cardTitle}>{card.title}</h3>
              <p style={styles.cardText}>{card.text}</p>
              <Link
                to={card.to}
                style={styles.cardLink}
                onMouseEnter={(e) => {
                  e.target.style.backgroundColor = styles.cardLinkHover.backgroundColor;
                  e.target.style.color = styles.cardLinkHover.color;
                }}
                onMouseLeave={(e) => {
                  e.target.style.backgroundColor = styles.cardLink.backgroundColor;
                  e.target.style.color = styles.cardLink.color;
                }}
              >
                More info &#8594;
              </Link>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
